INSERT INTO `pagina` (`id`, `titel`, `subtitel`, `inhoud`, `tags`, `aktief`, `module`, `aanmaakdatum`, `aangemaaktdoor`, `bewerkdatum`, `bewerktdoor`, `headerimg`, `studentlink`) VALUES
(22, 'Nick Simons', 'Welkom op mijn portfolio website.', '<h2><strong>Welkom</strong></h2>\r\n\r\n<p>Welkom op mijn portfolio website, Hier vind je alles over mij en over mijn school. Je kan hier de opdrachten en studiegenoten vinden.</p>\r\n\r\n<p><em>Hallo</em></p>\r\n', NULL, 'ja', 4, '2016-01-11 14:28:34', 'Nick Simons', '2017-11-23 16:17:48', 'Nick Simons', '<br /><b>Warning</b>:  imagepng(uploadedafb/75dba90254918a044fdfe6a79869821b476c673f.png): failed to open stream: Permission denied in <b>/Applications/XAMPP/xamppfiles/htdocs/cms/admin/classes/page.class.php</b> on line <b>259</b><br />75dba90254918a044fdfe6a79869821b476c673f.png', ''),
(27, 'Over mij', 'Ben jij benieuwd wie ik ben en wat ik doe, kijk dan verder', '<h2>Over mij</h2>\r\n\r\n<p>Welkom op mijn website. Mijn naam is Nick Simons, ik ben 18 jaar oud. Op dit moment zit ik op Landstede Raalte bij de Applicatieontwikkelaar afdeling. Ik woon in Rijssen samen met mijn moeder, om de week ben ik het weekend bij mijn vader, zijn vriendin en zoontje.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Over de website</h2>\r\n\r\n<p>De hele website is door mij gemaakt, tijdens mijn school uren. Dit was een opdracht, zodat we straks alles op &eacute;&eacute;n website hebben staan. Op deze deze website komt informatie over mij en de opdrachten die ik op school moet maken. De hele website word gemaakt met HTML5 en CSS3. HTML gebruiken we voor de inhoud, en CSS gebruiken we voor de opmaak en het positioneren van de elementen.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>Mijn hobby&#39;s</h2>\r\n\r\n<p>Ik heb verschillende hobby&#39;s, mijn 1e hobby is natuurlijk gamen. Ik speel verschillende spellen zoals Call Of Duty, Battlefield, Watch Dogs en Assasin&#39;s creed. Vaak doe ik dit met vrienden en dan bellen we via skype.</p>\r\n\r\n<p>Ook houd ik van uitgaan. Ik ga vaak met vrienden naar een caf&eacute; en daar drinken we lekker een paar biertjes. Soms gaan we ook naar lucky of naar een tentfeest. Maar meestal zijn we te vinden in het caf&eacute;.</p>\r\n\r\n<p>Voetbal is ook een soort van hobby. Ik vind het super leuk om Feyenoord te kijken. Dit komt omdat mijn vader uit Rotterdam komt. Hij heeft het virus overgebracht. Af en toe ga ik naar een wedstijd, vaak wel in een skybox of business home, dan worden wij uitgenodigd. Heel soms ga ik nog naar Heracles, maar dat is lang niet zo leuk als Feyenoord.</p>\r\n\r\n<p>Natuurlijk vind ik programmeren ook heel leuk. Toen ik 13 was ben ik er mee begonnen, maar na 2 jaar er mee gestopt. Nu ik hier weer op school zit ben ik weer fanatiek aan het programmeren.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&lt;script&gt;alert(&quot;21&quot;);&lt;/scripts&gt;</p>\r\n', NULL, 'ja', 5, '2016-01-12 18:05:29', 'Nick Simons', '2016-01-21 09:58:56', 'Nick Simons', '04c55fca483cd87efa3721affc53b684ccbc6bf4.png', ''),
(29, 'Projecten', 'Bent u benieuwd naar wat ik allemaal op school moet doen, kijk dan verder', '', NULL, 'ja', 9, '2016-01-12 19:37:52', 'Nick Simons', '2016-01-14 10:59:50', 'Nick Simons', '', ''),
(30, 'Studenten', 'Bent u benieuwd wie mijn mede studenten zijn, kijk dan verder', '<h2>Studenten lijst 1e jaars</h2>\r\n\r\n<p>Hier onder vind u alle studenten van applicatie ontwikkelaar leerjaar 1</p>\r\n', NULL, 'ja', 7, '2016-01-12 19:38:11', 'Nick Simons', '2016-06-30 21:03:31', 'Nick Simons', '6ae5663cc0fb48daa303b8fc6e73f12e3594b58f.png', 'http://www.saldev.nl/json/studenten-sites-2014.json'),
(31, 'Test', 'test', '<p>dfsafasf</p>\r\n', NULL, 'ja', 5, '2016-06-26 18:45:07', 'Nick Simons', '2017-10-11 15:38:04', 'Nick Simons', 'fa1a78717454db162c479fb2edf3a0b7e7989927.png', ''),
