INSERT INTO `druif` (`druifID`, `naam`, `beschrijving`) VALUES
(1, 'Monastrell', 'Ook wel de Mourvèdre- of de Matarodruif genoemd. Druif met goede tannine.'),
(2, 'Tempranillo', 'Een blauwe druivensoort die ook wel de Koning van Spanje wordt genoemd. Laag zuurgehalte en geeft de wijn een medium body.'),
(3, 'Cabernet sauvignon', 'Ontstaan uit een kruising van de Cabernet Franc en de Sauvignon blanc. De Cabernet sauvignon is een blauwe druivensoort met een medium zuurgehalte. De druif geeft de wijn een zeer volle body.'),
(4, 'Grenache', 'De Spanjaarden noemen het de Garnacha. Deze druif houdt van de zon en wordt in de wereld het meest geplant. Heeft een laag zuurgehalte en geeft zeer veel body aan de wijn.'),
(5, 'Cariñena', 'Ook wel de Carignan genoemd, die veel rondom de Middelandse Zee geplant wordt. De druif geeft de wijn veel zuur, kleur en tannines.'),
(6, 'Merlot', 'De partner in crime van de Cabernet sauvignon. De druif is zacht, vlezig en makkelijk te laten groeien. Door het gemak wordt deze druif veel geplant in de wereld. Heeft een laag zuurgehalte en geeft de wijn een zeer volle body.'),
(9, 'Syrah', 'De Syrah wordt ook Shiraz genoemd en is een sterke druif die bestand is tegen de meeste plantenziektes. De druif doet het goed in warme en droge gebieden. Het heeft een medium zuurgraad en geeft de wijn en zeer volle body.'),
(10, 'Verdejo', 'Druif met een mooie zuurgraad en maakt de wijn fris en fruitig. De druif is erg gevoelig voor zuurstof en wordt daarom zo snel mogelijk geperst en in vaten gegoten.'),
(11, 'Albariño', 'Een nog onbekende druif uit Galicië, maar door zijn abrikozensmaak en een zacht bittertje zal het snel een bekende druif gaan worden. Geeft de wijn frisse zuren en een stevige structuur.'),
(13, 'Chardonnay', 'Een druif die over de hele wereld voorkomt en zeer geschikt voor rijping op hout. Geeft in de koele klimaatzones een appelsmaak aan de wijn.'),
(14, 'Macabeo', ' Wordt veel gebruikt in de heerlijke Spaanse Cava\'s. Geeft de wijn een hoog zuurgehalte en hoog alcoholpercentage. In de Rioja wordt de Macabeo ook wel Viura genoemd.'),
(15, 'Sauvignon blanc', 'Een van oorsprong Franse druif, die zich verspreidde met emigranten naar Spanje. Zorgt voor een buxusgeur, maar geeft een appel- en ananassmaak mee aan de wijn.'),
(16, 'Nick S', 'Fruitig');
