INSERT INTO `gebied` (`gebiedID`, `naam`, `beschrijving`, `hoofdgebiedID`) VALUES
(1, 'Almansa', 'Een rodewijngebied in het oosten van La Mancha dat sterk in opkomst is. De wijngaarden liggen voornamelijk op vlakke stukken vruchtbaar land met koolstofrijke grond. Het gebied heeft een woestijnklimaat: grote temperatuurwisselingen en vrij weinig neerslag.', 2),
(2, 'Castilië-La Mancha', 'In het zuidoosten van Madrid ligt het grote wijngebied Castilië-La Mancha. Stond vroeger bekend als het gebied waar de goedkope slobberwijntjes vandaan kwamen, maar is door de inzet van moderne technologieën en rijpingstechnieken de laatste jaren sterk in opmars', NULL),
(3, 'Rioja Alta', 'Rioja Alta is, zoals de naam doet vermoeden, een hooggelegen gebied in het westen van La Rioja. Het kalkrijke gebied staat bekend om de fruitige en elegante kwaliteitswijnen met niet teveel alcohol. ', 4),
(4, 'Rioja en Navarra', 'Het meest prestigieuze wijngebied ligt in het noorden van Spanje. Kreeg als enige wijngebied het hoogste appellationniveau: Denominación de Origen Calificada. ', NULL),
(5, 'Catalonië', 'De meeste sprankelende wijnregio van Spanje. Hier komen de bruisende cava\'s vandaan en de wijnen gemaakt van het sap van gefermenteerde Garnachadruiven. ', NULL),
(6, 'Toro', 'Niet alleen het klimaat is \'hot\', maar ook de wijnen! Er zijn maar weinig wijngebieden die de laatste jaren zoveel aan kwaliteit en populariteit hebben gewonnen als Toro.', 7),
(7, 'Castilië-Leon', 'in het noordoosten van Spanje liggen de wijnstreken Valdevimbre, Oteros en Cea, die zich tot één gebied hebben gevormd: Castilië-Leon. Het wijngebied is vooral bekend van de productie van rode en rosé wijn afkomstig van de inheemse blauwe druivensoort prieto picudo.', NULL),
(8, 'Terra Alta', 'Terra Alta is het meest zuidelijke en, zoals de naam al doet vermoeden, hoogst gelegen gebied van Catalonië. Het grootste belang ligt in lichte rode, witte en rosado wijnen, die in steeds grotere mate geproduceerd worden. Dat Terra Alta wat later op het nieuwe wijntoneel verscheen, is waarschijnlijk te wijten aan zijn kleine afmetingen en, tot voor kort, moeilijke bereikbaarheid.', 5),
(9, 'Navarra', 'Navarra heeft een golvend landschap en ligt in de vlakte van de Ebro. Zowel het klimaat als de wijn zijn in elk van de 5 subgebieden zeer verschillen, maar de bodemgesteldheid daarentegen is min of meer gelijk: zachte, diepe, vruchtbare bovengrond van lichte consistentie; ondergrond van grind met voornamelijk kalkhoudend vast gesteente dat uitstekend geschikt is voor het verbouwen van druivenstokken.', 4),
(10, 'Somontano', 'De naam betekent \'onder de bergen\', wat slaat op de uitlopers van de Pyreneeën in de provincie Huesca op nauwelijks 50 km van de Franse grens. Er wordt heel wat geëxperimenteerd in Somontano en momenteel zijn, op experimentele basis, bijna alle druivenvariëteiten toegestaan. ', 11),
(11, 'Aragon', 'De Spaanse wijnregio Aragon ligt in het noordoosten van het land. Van de Pyreneën tot aan Midden-Spanje. De wijnen uit Aragon zijn aan een opmars bezig. Vooral dankzij de inventieve wijnmakers uit het noordelijke Somontano.', NULL),
(12, 'Uclés', 'Het kleine wijngebied Uclés, iets ten Zuid-Oosten van Madrid, ligt op een hoogvlakte. Deze relatief koele ligging geeft een belangrijk voordeel vergeleken met gebieden die een stuk warmer zijn, zoals La Mancha. De groei van de druif gaat langzamer en gelijkmatig waardoor de wijnen frisser smaken en minder zwaar zijn. ', 2),
(13, 'Rias Baixas', 'In Rías Baixas vindt men nu volop zowel vernieuwde als totaal nieuwe bodegas, en wordt gekenmerkt door een toenemende belangstelling voor de versheid en kwaliteit van de druiven als ze aan de bodega geleverd worden. ', 14),
(14, 'Galicië', 'Gelegen in het uiterste noordwesten van het Iberisch Schiereiland, bevinden zich de wijngebieden uit Galicië. Door de recente waardering van de Albariño wijnen en de subsidie vanuit de EU en Madrid is dit gebied aan zijn opmars bezig.', NULL),
(15, 'Valdepenas', 'Valdepenas is een relatief klein gebied en wordt bijna helemaal omsloten door La Mancha. De beschutte ligging van Valdepenas behoedt het gebied voor warme, vochtige mediterrane winden. ', 2),
(16, 'La Mancha', 'In Spanje en in het buitenland moeten aficionados erkennen dat op de hoogvlakte van La Mancha een stille revolutie heeft plaatsgevonden. We vinden nu mooie verrassingen in La Mancha en gegeven de ijver waarmee de producenten hun wijn bereiden, van de zorg voor de bodem tot de temperatuur van hun gistingstanks, ziet de toekomst er veelbelovend uit. ', 2);
