INSERT INTO `producent` (`producentID`, `naam`, `beschrijving`, `website`) VALUES
(1, 'Palacio de Cirat', 'Producent met een wijngebied van 110 hectare.', 'www.Palacio.be'),
(2, 'Federico Paternina', 'Ontstaan in 1896 en veel bezocht door de Amerikaanse schrijver Ernest Hemingway (bekend van o.a. The Old Man and the Sea).', NULL),
(3, 'Bodegas Campo Viejo', 'De bodega werd in 2001 geopend en was zodanig ontworpen dat er een harmonieuze balans ontstaat tussen wijnmaken, architectuur en duurzaamheid. ', 'www.campoviejo.es'),
(4, 'Torres wines', 'Een familiebedrijf dat ontstaan is in 1870. ', 'www.torres.es'),
(5, 'Liberalia', 'Een familibedrijf dat in 2000 begon met het produceren van wijn.', 'www.liberalia.es'),
(6, 'Altos de Oliva', NULL, NULL),
(7, 'Bodegas Gran Feudo', 'In 1872 begon Claudio Chivite met de bouw van een nieuwe wijnmakerij La Cascajera genoemd naar de steengroeve waarop het was gelegen. Nu kennen we het als Bodegas Gran Feudo.', 'www.granfeudo.com'),
(8, 'Viñas Del Vero', 'Genoemd naar de rivier in het Somontanogebied, aan de voet van de Pyreneeën. Het bedrijf werd in 1986 opgericht met de koop van 550 hectare grond.', 'www.vinasdelvero.es'),
(9, 'Bodegas Fontana', NULL, 'www.bodegasfontana.com'),
(10, 'Paco & Lola', 'Een jonge en moderne wijnmakerij die sinds 2005 is ontstaan uit een groep onafhankelijke wijnmakers die ondergebracht zijn in de coöperatie \"Sociedad Cooperativa Vitivinícola Arousana\".', 'www.pacolola.com'),
(11, 'Felix Solis', 'Een familibedrijf dat kwaliteitswijnen, druivensap en sangria produceert. Het bedrijf bestaat uit twee wijnmakerijen in het centrum van Spanje.', 'www.felixsolis.com'),
(12, 'Berberana', 'Eén van de oudste wijnhuizen in La Rioja (opgericht in 1877), maar ook één van de best verkopende Spaanse wijnmerken over de hele wereld.', 'www.berberana.com');
