(2, 'Mesta', 2014, 1, '12.0', 'Fris en fruitig wijntje, maar ontwikkelt zich als vol en krachtig in de mond.', NULL, 9, 12),
(3, 'Glorieta', 2012, 3, '14.0', 'Smaakvolle en volrode wijn die zacht en rond begin en eindigt met een frisse en aromatische afdronk.', 6, 1, 1),
(4, 'Finca Lapiedra', 2011, 3, '13.0', 'Zachte en fruitige dinerwijn. Heerlijk slobberwijntje voor een tussengerecht.', NULL, 8, 10),
(5, 'Gran Feudo', 2009, 3, '13.0', 'Mooie dinerwijn, maar ook uiterst geschikt om zomaar even van te genieten.', 9, 7, 9),
(6, 'Altos d\'Oliva', 2005, 3, '13.5', 'Geurige wijn met een kruidig eikenhouten en zachte afdronk.', 12, 6, 8),
(7, 'Liberalia Cero', 2012, 3, '14.5', 'De wijn met het touwtje staat bekend om de combinatie van kracht en souplesse. U zult genieten van donker en zwart fruit.', 3, 5, 6),
(8, 'Viña Brava Rosado', 2014, 2, '13.5', 'Zachte maar toch ook krachtige wijn.', NULL, 4, 5),
