(10, 'Rioja Reserva', 2009, 3, '13.5', 'Zachte wijn met veel smaak. Ga er even rustig bij zitten en geniet van deze wijn (met een kaasplankje)', 9, 2, 3),
(11, 'Albariño Rias Baixas', 2013, 1, '12.5', 'Heerlijke aperatiefwijn van de onbekende albariñodruif.', NULL, 10, 13),
(12, 'Los Molinos Tempranillo', 2014, 3, '12.5', 'Volle en vriendelijke wijn om zomaar even in te schenken. ', NULL, 11, 15),
(13, 'Viña Albali Reserva', 2010, 3, '13.0', 'Smaakvolle wijn en uiterst geschikt bij een film of bij een gezellig of romantisch gesprek. Hoeveel verschillende specerijen proef je?', 9, 11, 15),
(14, 'Pink Dragon', 2014, 2, '12.0', 'Frisse rosé met de volle smaak van rijpe aardbeien.', NULL, 12, 16),
